import { Link } from 'react-router-dom';

import './alpha-select.css';

const AlphaSelect = () => {

    const elements = [];

    for (let i = 0; i < 26; i++) {
        elements.push(<p key={i}><Link className='link-styles'>{String.fromCharCode(65 + i)} </Link> </p> );
    }

    return (
        <div className="alphaBox">
            {elements}
        </div>
    )
}

export default AlphaSelect;
